function I = fcnK4C(S, t, u, alpha, F, tol)
t1 = 0.1e1 ./ u;t3 = F .^ 2;t6 = sqrt(t3 .* S + u);t9 = S .* alpha;t10 = -t9 + u;t11 = 0.1e1 ./ t10;t12 = t11 .* alpha;t13 = sqrt(-alpha);t14 = F - t13;t15 = 0.1e1 ./ t14;t16 = t14 .^ 2;t18 = t13 .* S;t19 = t14 .* t18;t22 = sqrt(t16 .* S + 0.2e1 .* t19 - t9 + u);t23 = 0.1e1 ./ t22;t27 = t10 .^ 2;t28 = 0.1e1 ./ t27;t29 = t28 .* t13;t33 = S .^ 2;t34 = alpha .^ 2;t36 = t28 .* t34 .* t33;t41 = sqrt(t10);t44 = 0.1e1 ./ t41 ./ t27 .* t13;t48 = log(0.2e1 .* t15 .* (t22 .* t41 + t19 - t9 + u));t52 = t1 .* t12;t57 = F + t13;t58 = 0.1e1 ./ t57;t59 = t57 .^ 2;t61 = t57 .* t18;t64 = sqrt(t59 .* S - 0.2e1 .* t61 - t9 + u);t65 = 0.1e1 ./ t64;t79 = log(0.2e1 .* t58 .* (t64 .* t41 - t61 - t9 + u));t88 = 0.1e1 ./ t13 .* alpha;t93 = 0.1e1 ./ t41 ./ t10;t103 = 0.1e1 ./ t6 .* t1 .* F + t23 .* t15 .* t12 ./ 0.4e1 + 0.3e1 ./ 0.4e1 .* t23 .* t29 .* t9 + 0.3e1 ./ 0.4e1 .* F .* t23 .* t1 .* t36 - 0.3e1 ./ 0.4e1 .* t48 .* t44 .* t9 + 0.5e1 ./ 0.4e1 .* F .* S .* t23 .* t52 + t65 .* t58 .* t12 ./ 0.4e1 - 0.3e1 ./ 0.4e1 .* t65 .* t29 .* t9 + 0.3e1 ./ 0.4e1 .* F .* t65 .* t1 .* t36 + 0.3e1 ./ 0.4e1 .* t79 .* t44 .* t9 + 0.5e1 ./ 0.4e1 .* F .* S .* t65 .* t52 - 0.3e1 ./ 0.4e1 .* t23 .* t11 .* t88 + 0.3e1 ./ 0.4e1 .* t48 .* t93 .* t88 + 0.3e1 ./ 0.4e1 .* t65 .* t11 .* t88 - 0.3e1 ./ 0.4e1 .* t79 .* t93 .* t88;
I = t103(:,:,2) - t103(:,:,1);

end
